import Header from "./components/header/Header";
import "./app.scss"

function App() {
  return (
    <div className="app">
    <Header />
    <div className="container">
    <Block color="E0C097"/>
    <Block color="BD1616"/>
    <Block color="BD4B4B"/>
    <Block color="0A81AB"/>
    <Block color="BA135D"/>
    <Block color="D8AC9C"/>
    </div>
    </div>
  );
}

export default App;
